import Card from "./Components/Card";
import  Component  from "./Components/ExpenseItem";
import "./Components/011 ExpenseItem.css";
 function App() {
  const expense=[
    {title:"travelling",price:225.5,date:new Date(2021,5,16),location:"mumbai"},
    {title:"car washing",price:22.5,date:new Date(2021,9,19),location:"dehradun"},
    {title:"shopping",price:2250.5,date:new Date(2021,10,6),location:"pacific mall"},
    {title:"resturant",price:2200.5,date:new Date(2021,11,11),location:"doon zaika"}
  ]
  return (
    <Card className="expense">
      {/* <h2>Let's get started!</h2> */}
      <Component title={expense[0].title} price={expense[0].price} date={expense[0].date} location={expense[0].location}></Component>
      <Component title={expense[1].title} price={expense[1].price} date={expense[1].date} location={expense[1].location}></Component>
      <Component title={expense[2].title} price={expense[2].price} date={expense[2].date} location={expense[2].location}></Component>
      <Component title={expense[3].title} price={expense[3].price} date={expense[3].date} location={expense[3].location}></Component>
    </Card>
  );
}

export default App;
